import React, { useState } from "react";
import styles from "./Login.module.css";
import { HiMail as Mail } from "react-icons/hi";
import { RiLockPasswordFill as Pw } from "react-icons/ri";
import { SiGmail as Gm } from "react-icons/si";
import { FaFacebookF as Fb } from "react-icons/fa";

const initialState = {
    form: {
        username: "",
        password: "",
    },
};

function Login() {
    const [state, setstate] = useState(initialState);
    console.log(state);
    return (
        <div className={styles.container}>
            <div className={styles.container2}>
                <div className={styles.formGroup}>
                    <br />
                    <label>
                        <Mail />
                        Correo:
                    </label>
                    <br />
                    <input type="text" className={styles.formControl} />
                    <br />
                    <br />
                    <label>
                        <Pw />
                        Contraseña:
                    </label>
                    <br />
                    <input type="password" className={styles.formControl} />
                    <br />
                    <br />
                    <button className={styles.btnLogin}>Iniciar sesión</button>
                    <br />
                    <br />
                    <span>OR</span>
                    <br />
                    <br />
                    <a href="">
                        <Gm /> Ingresa con Gmail
                    </a>
                    <br />
                    <a href="">
                        <Fb /> Ingresa con Facebook
                    </a>
                    <p>¿No tienes una cuenta?</p>
                    <button className={styles.btnLogin}>Regístrate</button>
                    <br />
                </div>
            </div>
        </div>
    );
}

export default Login;
